import React from 'react';
import { View ,StyleSheet } from 'react-native';

function NavBar(props) {
    return (
        <View style={styles.navbar}></View>
    );
}

const styles = StyleSheet.create({
    navbar: {
        height: 100,
        width: '100%',
        backgroundColor: "rgba(254, 253,255)",
    }
})

export default NavBar;
